    constructor() {
        super();
        this.state={
            accountNumber:"102",
            balance:''
        }
    }


    render() {
        return(

            <Row>
                <Col sm="6">
                    <Card body>
                        <CardTitle tag="h5">Withdraw Money</CardTitle>
                        <input type="" />
                        <Button>Go somewhere</Button>
                    </Card>
                </Col>
            </Row>
        );
    }

}
export default Withdraw;
